import React from "react";
import { useParams } from 'react-router-dom';

import { ContainerPage, TittlePage } from "../../components/Main";



const Nivalamento = () => {
    // Obtém o parâmetro 'data' da URL
    const { data } = useParams();
  
    return (
      <div>
        <h1>Dados Nivalamento</h1>
        <p>Dados selecionados: {data}</p>
        {/* Adicione aqui qualquer lógica ou apresentação relacionada aos dados de nivalamento */}
      </div>
    );
  };

const Page = () => {
    return (

        <ContainerPage>

            <TittlePage>
                <div className="wc-text">Ótimo!<br /> Agora nos informe em que nível você se encontra em cada técnologia seleciada</div>
            </TittlePage>

            


           

        </ContainerPage>

    );
}

export default Page;
